function drawChart(stationName) {
    console.log(stationName);
    var stationMap = {
        "Deweys Mill"   : DeweysMill,
        "Boltonville Hydro Associates" : BoltonvilleHydroAssociates,
        "Ottauquechee Hydro" : OttauquecheeHydro,
        "Ascutney" : Ascutney,
        "Cavendish" : Cavendish,
        "Fairfax Falls" : FairfaxFalls,
        "Milton" : Milton,
        "Pittsford" : Pittsford,
        "Salisbury" : Salisbury,
        "Weybridge" : Weybridge,
        "Newport" : Newport,
        "Essex Junction 19" : EssexJunction19,
        "Middlesex 2" : Middlesex2,
        "Harriman" : Harriman,

    };



    var data = google.visualization.arrayToDataTable(stationMap[stationName]);

    var options = {
        title: 'Total Generation: '+stationName,
        legend: {position: 'none'}
    };

    var chart = new google.visualization.LineChart(document.getElementById('powerplantChart'));

    chart.draw(data, options);
    drawPieChart();
    drawOutagesPie();
}

